<?phpnamespace Nemundo\WebLog\Data\Browser;class BrowserReader extends \Nemundo\Model\Reader\ModelDataReader {/*** @var BrowserModel*/public $model;public function __construct() {parent::__construct();$this->model = new BrowserModel();}/*** @return BrowserRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = $this->getModelRow($dataRow);$list[] = $row;}return $list;}/*** @return BrowserRow*/public function getRow() {$dataRow = parent::getRow();$row = $this->getModelRow($dataRow);return $row;}/*** @return BrowserRow*/public function getRowById($id) {return parent::getRowById($id);}private function getModelRow($dataRow) {$row = new BrowserRow($dataRow, $this->model);$row->model = $this->model;return $row;}}